contract subsidy{
    struct operate_in{   //
        uint8 _number;  //
        uint8 _operator;  //
        uint16 _year;    //   
        uint8 _month;  //
        uint8 _day;   //
        uint16 _time; //
        uint16 _people; //        
        string _plate; //        
    }

    struct money_in{
        uint16 _money_all;  //
        uint32 _mileage;  //
        uint16 _year_of_season; //        
        uint8 _season; //
        uint16 _disable;    //
        uint16 _disable_actual; //
        uint16 _elder;    //
        uint16 _elder_actual; //

    }

    struct data_in{   //
        uint16 _data_year_of_season; //
        uint8 _data_season; //        
        uint8 _data_operator;  //
        bytes32  _hash;  //hash
    }
    
    mapping (uint => operate_in) map_operate_in;
    mapping (uint => money_in) map_money_in;
    mapping (uint => data_in) map_data_in;
    uint16 count_operate=0; //
    uint16 count_money=0; //
    uint16 count_data=0; //

    function operate(uint8 _number, uint8 _operator, uint16 _year, uint8 _month, uint8 _day, uint16 _time, uint16 _people, string memory _plate) public {  //
        operate_in storage c = map_operate_in[count_operate];  //slide
        c._number=_number;
        c._operator=_operator;
        c._year=_year;
        c._month=_month;
        c._day=_day;
        c._time=_time;            
        c._people=_people;
        c._plate=_plate;   
        count_operate=count_operate+1; 
    }

    function money(uint16 _money_all, uint32 _mileage, uint16 _year_of_season, uint8 _season, uint16 _disable, uint16 _disable_actual, uint16 _elder, uint16 _elder_actual) public {  //
        money_in storage c = map_money_in[count_money];  //slide
        c._money_all=_money_all;
        c._mileage=_mileage;
        c._year_of_season=_year_of_season;
        c._season=_season;
        c._elder=_elder;
        c._elder_actual=_elder_actual;
        c._disable=_disable;
        c._disable_actual=_disable_actual;         
        count_money=count_money+1;
    }

    function data(uint16 _data_year_of_season, uint8 _data_season, uint8 _data_operator, bytes32 _hash) public {  //
        data_in storage c = map_data_in[count_data];  //slide
        c._data_year_of_season=_data_year_of_season;
        c._data_season=_data_season;
        c._data_operator=_data_operator;
        c._hash=_hash; 
        count_data=count_data+1;  
    }

    function subsidyMotc(uint16 year, uint8 season, uint8 number, uint8 operator) public view returns(uint32, uint32, uint16){ //
        uint32 subsidys=0;   //
        uint32 cost=0; //
        uint32 revenue=0; // 
        uint32 mileage=0; //(*1000)
        uint16 people=0;   //
        //uint32 count=0;
        for(uint16 i=0; i<count_operate; i++){  //()
            if(operator==map_operate_in[i]._operator){ //
                if(year==map_money_in[i]._year_of_season){ //
                    if(season==map_money_in[i]._season){//
                        if(number==map_operate_in[i]._number){//
                            mileage=mileage+map_money_in[i]._mileage; //*()
                            revenue=revenue+map_money_in[i]._money_all;//
                            people=people+map_operate_in[i]._people;
                        }
                    }
                }
            }
        }
        cost=(mileage*29)/1000;//1000:
        subsidys=cost-revenue;
        return(subsidys, (mileage/1000), people);
    }    


    function subsidyPt(uint16 year, uint8 month, uint8 number, uint8 operator) public view returns(uint32, uint32, uint32, uint32){
        //what:
        uint32 disable_subsidy; //
        uint32 disable_total_subsidy;   //
        uint32 elder_subsidy; //
        uint32 elder_total_subsidy;   //
        for(uint16 j=0; j<count_operate; j++){//
            if(operator==map_operate_in[j]._operator){ //
                if(year==map_operate_in[j]._year){ //
                    if(month==map_operate_in[j]._month){    //
                        disable_total_subsidy=disable_total_subsidy+map_money_in[j]._disable-map_money_in[j]._disable_actual;  //
                        elder_total_subsidy=elder_total_subsidy+map_money_in[j]._elder-map_money_in[j]._elder_actual;  //
                        if(number==map_operate_in[j]._number){
                            disable_subsidy=disable_subsidy+map_money_in[j]._disable-map_money_in[j]._disable_actual;  //
                            elder_subsidy=elder_subsidy+map_money_in[j]._elder-map_money_in[j]._elder_actual;  //                          
                        }
                    }
                }
            }
        }
        return(disable_subsidy, disable_total_subsidy, elder_subsidy, elder_total_subsidy);
    }

    function find_hash(uint16 year, uint8 month, uint8 data_operator, bytes32 data_hash) public view returns(uint8){
        for(uint16 i=0; i<count_data; i++){
            if(year==map_data_in[i]._data_year_of_season){
                if(month==map_data_in[i]._data_season){
                    if(data_operator==map_data_in[i]._data_operator){
                        if(data_hash==map_data_in[i]._hash)
                            return(1);                            
                    }
                }
            }
        }
        return(0);
    }
}
